import React from 'react'

const Square=()=>{
  return (
    <div>
    style={{
        border:"1px solid red",
        height:"100px",
        width:"100%",
        display:"flex",
    }
    }
    <div className='Square'>
     <h5>X</h5>
    </div>
    </div>
  )
}

export default Square
